# 柠檬水找零问题
# 贪心 数组

# 在柠檬水摊上，每一杯柠檬水的售价为 5 美元。顾客排队购买你的产品，（按账单 bills 支付的顺序）一次购买一杯。
# 每位顾客只买一杯柠檬水，然后向你付 5 美元、10 美元或 20 美元。 一次只能买一杯
# 你必须给每个顾客正确找零，也就是说净交易是每位顾客向你支付 5 美元。
# 注意，一开始你手头没有任何零钱。
# 给你一个整数数组 bills ，其中 bills[i] 是第 i 位顾客付的账。
# 如果你能给每位顾客正确找零，返回 true ，否则返回 false 。

# 匹配问题 看付款是否满足找零 一次实际只能收五元

# bills = [5,5,10,10,20]
# 输出：false 第三杯 [5,10] 第四杯 [10,10] 第五杯收20 无法找15元 false
# 只有5，10，20的情况分开讨论
# 双指针 一个用来找零 一个遍历账单


from typing import List
class Solution:
    def lemonadeChange(self, bills: List[int]) -> bool:
        change = 0 # 找零指针
        bill = 0 # 账单指针

        # 遍历账单bills
        # 遇到5 不用找零 账单指针+1 找零指针不变
        for i in range(len(bills)):

            if bills[bill] == 5:
                bill += 1

        # 遇到10 找零指针碰到5加1 找零指针索引最大为账单指针减1

            elif bills[bill] == 10:

                five = 0
                t = sorted(bills[change:bill])  # 把已经有的零钱排序
                bills[change:bill] = t  # 重新排序


                for j in range(change,bill):

                    if bills[j] == 5:
                        bill += 1
                        change += 1
                        five += 1
                        break
                if five == 0:
                    print('10',bill, ':', change)
                    return False # 遍历完没有找到5则返回false无法找零
            # 遇到20 找零15 遍历两次到10和5 或者 三个5 才能继续否则返回false
            elif bills[bill] == 20:
                five = 0
                ten = 0
                t = sorted(bills[change:bill]) # 把已经有的零钱排序
                bills[change:bill] = t # 重新排序
                for j in range(change,bill):

                     if bills[j] == 5:

                        change += 1
                        five += 1

                        if five >= 3:
                            break

                     elif bills[j] == 10:
                        change += 1
                        ten += 1
                        if ten >= 1 and five >= 1:
                            t = sorted(bills[change:bill])  # 把剩余的有的零钱排序
                            bills[change:bill] = t  # 重新排序

                            break
                if not(five >=3 or (ten >= 1 and five >= 1)):
                    print('20:',bill,':',change)
                    return False # 找零15失败
                bill += 1 # 账单指针+1



        return True
