from typing import List

print("\n\n我根据这个思路写的")
class Solution3:
    def lemonadeChange(self, bills: List[int]) -> bool:
        five = 0
        ten = 0
        for i in range(len(bills)):
            if bills[i] == 5:
                five += 1
            #  break会跳出全部的循环和判断
            elif bills[i] == 10:
                if five >= 1:
                    five -= 1
                    ten += 1
                    
                else:
                    return False
            elif bills[i] == 20:
                # 不用写else执行完全部的elif就会进入下一层循环

                if ten and five:  # 有十块先找十块
                    ten -= 1
                    five -= 1


                elif five >= 3:
                    five -= 3

                else:
                    return False
        return True
bills = [5,5,10,10,20]
print(Solution3().lemonadeChange(bills))

